import React from 'react'
import "./header.css"
import { Link, useNavigate } from 'react-router-dom'



function HeaderComponente(){

    const navigate = useNavigate();
    const goToLoginPage = () => {
      navigate('/login');
    };

    return(
        <header>
             <ul class="navbar">
                <li>
                    <div class="logo_nome">
                        <img src='/imagens/logo_white.png' id='logo_img'></img>
                        <h1 class="hotel_name">HOTEL GREEN GARDEN</h1>
                    </div>
                </li>
                <li>
                    <div class="login_menu">
                        <button class="login_button" onClick={goToLoginPage}>LOGIN</button>
                        <button class="menu_button"><span><svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 448 512"><path d="M0 96C0 78.3 14.3 64 32 64l384 0c17.7 0 32 14.3 32 32s-14.3 32-32 32L32 128C14.3 128 0 113.7 0 96zM0 256c0-17.7 14.3-32 32-32l384 0c17.7 0 32 14.3 32 32s-14.3 32-32 32L32 288c-17.7 0-32-14.3-32-32zM448 416c0 17.7-14.3 32-32 32L32 448c-17.7 0-32-14.3-32-32s14.3-32 32-32l384 0c17.7 0 32 14.3 32 32z"/></svg></span></button>
                    </div>
                </li>
             </ul>
        </header>
    )
}


export default HeaderComponente
